if (relexOffset == change.matchOffset && LexerUtilsConstants.statesEqual(state,(change.matchIndex > 0) ? tokenList.state(change.matchIndex - 1) : null)) {
  if (change.matchIndex == tokenCount)   break;
  int matchPointOrigLookahead=(change.matchIndex > 0) ? tokenList.lookahead(change.matchIndex - 1) : 0;
  if (lookahead == matchPointOrigLookahead || matchPointOrigLookahead <= 1 && lookahead <= 1) {
    break;
  }
  int afterMatchPointTokenLength=tokenList.tokenOrEmbeddingDirect(change.matchIndex).token().length();
  if (matchPointOrigLookahead <= afterMatchPointTokenLength && lookahead <= afterMatchPointTokenLength) {
    break;
  }
  int afterMatchPointOrigTokenLookahead=tokenList.lookahead(change.matchIndex);
  if (lookahead - afterMatchPointTokenLength <= afterMatchPointOrigTokenLookahead && (matchPointOrigLookahead <= afterMatchPointTokenLength || lookahead >= matchPointOrigLookahead)) {
    break;
  }
  if (loggable) {
    LOG.log(Level.FINE,"    EXTRA-RELEX: maInd=" + change.matchIndex + ", LA="+ lookahead+ "\n");
  }
  change.increaseMatchIndex();
}

